  false,\n\t\"url\": null,\n\t\"notes\": \"Belt transects along 2 consecutively-placed,
  25m transect lines were surveyed as part of Rapid Ecological Assessments conducted
  at 8 sites at Ofu and Olosega Islands in American Samoa in February, 2004 from the
  NOAA vessel Oscar Elton Sette (OES04-02). Raw survey data included genus presence
  and relative abundance, colony counts and size classes, and visual estimation of
  percent cover. Either 0.5m or 1m on each side of the transect lines were included
  in the belt (for a total of 50m2 or 100m2 per site), depending on colony density.\",\n\t\"license_title\":
